import React from 'react';
import CreatePost from '../components/Post/CreatePost';
import PostList from '../components/Post/PostList';

function Feed() {
  return (
    <div className="feed-container">
      <CreatePost />
      <PostList />
    </div>
  );
}

export default Feed;
